import React, { useMemo } from 'react';
import './style.css'
export const PaymentComponent = ({ right, data }) => {
    const renderTable = useMemo(() => {
        return <table className='table'>
            <tr className='tr'>
                <th><h2>Наименование</h2></th>
                <th><h2>Цена</h2></th>
                <th><h2>Колличество</h2></th>
                <th><h2>Стоимость</h2></th>
            </tr>
            {data.map(item => {
                return <tr className='tr'>
                    {item.map(items => {
                        if (items) {

                            return items === 'Итого' ? <th><h3>{items}</h3></th> : <td><h3>{items}</h3></td>
                        }
                        return <td>
                            <input />
                        </td>
                    })}
                </tr>
            })}
        </table>
    }, [data])
    return (
        <div className={`wrapper wrapper-words ${right ? 'right-wrapper' : ''}`} >
            {renderTable}
        </div>
    );
};
